One of the most interesting features of DEXON is that it has an on-chain random oracle. An “on-chain” random oracle means that the random source is retrieved directly on the chain itself, instead of having to feed it in by external sources. Remix IDE also supports this feature You can use the rand keyword in Remix IDE. Sample code: pragma solidity ^0.5.0;
contract Rand { uint256 value; function update() public { value = rand; } function get() view public returns (uint256) { return value; }
}
